import Link from "next/link";

const Navegacion = () => (
  <div>
    <ul>
      <li>
        <Link href="/">
          <a>Inicio</a>
        </Link>
      </li>
      <li>
        <Link href="/nosotros">
          <a>Nosotros</a>
        </Link>
      </li>
    </ul>
    <style jsx>{`
      ul {
        background-color: #333;
        list-style: none;
        display: 'flex',
      }
      ul li {
          padding: .5rem 0;
          marginRight: 1rem;
      }
      ul li a {
          fontSize: 1.2rem;
          color: white;
          textDecoration: none
      }
    `}</style>
  </div>
);

export default Navegacion;
